import React, { Component } from "react";

export class Item extends Component {
  render() {
    return (
      <div className="item">
        <img
          src={require("../assets/" + this.props.item.img)}
          alt={this.props.item.title}
        />
        
      </div>
    );
  }
}

export default Item;
